import React from 'react';

const NavBar = () => {
  return (
    <div>
      <Link to="/login">
        <button type="button">
          Login
        </button>
      </Link>

      <Link to="/sign_up">
        <button type="button">
          Register
        </button>
      </Link>
    </div>
  );
};

export default NavBar;
